El soneto "Al peregrino" parece ser un poema de Lope de Vega, un famoso poeta español del Siglo de Oro, que vivió entre los siglos XVI y XVII (1562-1635). El texto hace referencia al propio Lope en primera persona y tiene un estilo característico de su época.
